class WsRunner{runner=null;requests=[];errorMessage='Unable to execute code. Please reload the page.';constructor(init){const lang=getShareLang();if(init&&lang!=='javascript'){this.runner=new WebSocket(`wss://ws.reqbin.com/${lang}`);this.runner.onopen=this.onOpen.bind(this);this.runner.onclose=this.onClose.bind(this);this.runner.onmessage=this.onMessage.bind(this);this.runner.onerror=this.onError.bind(this);}}
onOpen(){console.log("ReqBin Runner: connected");}
onClose(){console.log("ReqBin Runner: connection closed");this.returnError(this.errorMessage);}
onError(){console.log("ReqBin Runner: connection error");this.returnError(this.errorMessage);}
onTimeout(id){console.log("ReqBin Runner: timeout");this.returnResult(id,this.errorMessage);}
onMessage(event){const data=JSON.parse(event.data);this.returnResult(data.id,data.result);}
execCode(lang,code,callback){const id=Math.floor(Math.random()*1000000000);const data={id,lang,code};if(!this.runner||this.runner.readyState==2||this.runner.readyState==3){console.log("ReqBin Runner: not initialized");callback(null,this.errorMessage);return;}
if(this.runner.readyState==0){setTimeout((x)=>{this.execCode(lang,code,callback);},100);return;}
this.runner.send(JSON.stringify(data));const timeout=setTimeout(this.onTimeout.bind(this),5000,id);this.requests.push({id,timeout,callback});}
returnResult(id,result){for(let idx=0;idx<this.requests.length;idx++){const item=this.requests[idx];if(item.id===id){clearTimeout(item.timeout);this.requests.splice(idx,1);item.callback(null,result);break;}}}
returnError(result){for(let idx=0;idx<this.requests.length;idx++){const item=this.requests[idx];clearTimeout(item.timeout);item.callback(null,result);}
this.requests.length=0;}}
class JsWorker{worker=null;callback=null;errorMessage='Unable to execute code. Please reload the page.';constructor(init){if(init){this.worker=new Worker("/worker");this.worker.onmessage=this.onMessage.bind(this);this.worker.onerror=this.onError.bind(this);}}
onError(){console.log("ReqBin Worker: error");this.callback(this.errorMessage);}
onMessage(event){const data=event.data;this.callback(data);}
execCode(code,callback){if(!this.worker){console.log("ReqBin Worker: not initialized");callback(null,this.errorMessage);return;}
this.callback=callback;this.worker.postMessage(code);}}
